public protocol GraphFactoryCreationListener {
    func graphCreationSuccessful(graph: Graph)
    func graphCreationFailed(error: ErrorType)
}

public class GraphFactory {
    public class func createGraphWithComponents(vertices: [Vertex], edges: [Edge]) -> Graph {
        let g = Graph()
        
        for v in vertices {
            g.addVertex(v.id, vertex: v)
        }
        
        for e in edges {
            g.addEdge(e)
        }
        
        return g
    }
    
    public class func createGraphFromJsonFile(filePath: String, listener: GraphFactoryCreationListener) {
        self.createGraphFromJsonFile(filePath, completionHandler: {(graph, error) in
            if error == nil && graph != nil {
                listener.graphCreationSuccessful(graph!)
            } else {
                listener.graphCreationFailed(error!)
            }
        })
    }
    
