    public class func createGraphFromBundleResource(fileName: String, completionHandler: (Graph?, ErrorType?) -> ()) {
        do {
            if let fileContent: String? = try FileSystemHandler.readFileFromBundle(fileName) {
                if let graph: Graph? = try JsonVisitor().parseJsonObject(fileContent!) {
                    completionHandler(graph!, nil)
                }
            }
        } catch let error {
            completionHandler(nil, error)
        }
    }
    
    public class func createExampleGraph(completionHandler: (Graph?, ErrorType?) -> ()) {
        let graph = Graph()
        var vertexIds = [UInt64]()
        
        for _ in 0 ... 20 {
            vertexIds.append(graph.addVertex(nil).getId())
        }
        
        do {
            for i in 2 ... 20 {
                try graph.addEdge(vertexIds[1], sideBId: UInt64(vertexIds[i]), direction: .Forward, data: nil)
            }
        } catch let error {
            completionHandler(nil, error)
        }
        
        do {
            try graph.addEdge(vertexIds[1], sideBId: vertexIds[5], direction: .Forward, data: nil)
            try graph.addEdge(vertexIds[1], sideBId: vertexIds[3], direction: .Forward, data: nil)
            try graph.addEdge(vertexIds[1], sideBId: vertexIds[10], direction: .Forward, data: nil)
            try graph.addEdge(vertexIds[1], sideBId: vertexIds[8], direction: .Forward, data: nil)
