            try graph.addEdge(vertexIds[2], sideBId: vertexIds[7], direction: .Forward, data: nil)
            try graph.addEdge(vertexIds[2], sideBId: vertexIds[5], direction: .Forward, data: nil)
            try graph.addEdge(vertexIds[3], sideBId: vertexIds[18], direction: .Forward, data: nil)
            try graph.addEdge(vertexIds[3], sideBId: vertexIds[5], direction: .Forward, data: nil)
            try graph.addEdge(vertexIds[3], sideBId: vertexIds[6], direction: .Forward, data: nil) // 10
            try graph.addEdge(vertexIds[4], sideBId: vertexIds[17], direction: .Forward, data: nil)
            try graph.addEdge(vertexIds[4], sideBId: vertexIds[20], direction: .Forward, data: nil)
            try graph.addEdge(vertexIds[4], sideBId: vertexIds[13], direction: .Forward, data: nil)
            try graph.addEdge(vertexIds[5], sideBId: vertexIds[15], direction: .Forward, data: nil)
            try graph.addEdge(vertexIds[5], sideBId: vertexIds[20], direction: .Forward, data: nil) // 15
